import React, { Component } from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import { logoutPlayer } from "../../actions/authActions";
import {connect} from "react-redux";

class Navbar extends Component {
    onLogoutClick = e => {
        e.preventDefault();
        this.props.logoutPlayer();
    };


  render() {
      const { player } = this.props.auth;


    return (
      <div className="navbar-fixed">
        <nav className="z-depth-0">
          <div className="nav-wrapper white">

            <h2>
                
            </h2>

            <Link
              to="/"
              style={{
                fontFamily: "monospace"
              }}
              className="col s5 brand-logo center-left black-text"
            >
              <i className="material-icons">code</i>
              MERN
            </Link>
            <Link
                to="/login"
                style={{
                  width: "140px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect grey right black-text"
            >
              Log In
            </Link>
            <Link
                to="/myaccount"
                style={{
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                My Account
            </Link>
            <Link
                to="/mystats"
                style={{
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                My Statistics
            </Link>
            <Link
                to="/leaderboard"
                style={{
                borderRadius: "3px",
                letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                Leaderboard
            </Link>
            <Link
                to="/forum"
                style={{
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
              >
                Forum
            </Link>
            <Link
                to="/dashboard"
                style={{
                borderRadius: "3px",
                letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white right black-text"
            >
                Dashboard
            </Link>
          </div>
        </nav>
      </div>
    );
  }
}

Navbar.propTypes = {
    logoutPlayer: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
    auth: state.auth
});

export default connect(
    mapStateToProps,
    { logoutPlayer }
)(Navbar);
